# Install hints:
# ==============
#
# This script requires the Math::BigInt::GMP and Net::Packet modules.
#
# On a Debian system, you can install Math::BigInt::GMP using
# the libmath-bigint-gmp-perl package.
#
# No such luck for Net::Packet, though. It requires the dnet library,
# which you can get at libdnet.sf.net. Compile and install it, then
# run cpan Net::Packet to install the Net::Packet module and its
# dependencies.

use strict;
use warnings;
use English;

use Data::Dumper;
use Getopt::Long;
use Pod::Usage;
use Math::BigInt lib => 'GMP';
use Storable qw( lock_nstore lock_retrieve );
require Net::Packet::Dump;
use Net::Packet::Consts qw(:dump);
use Term::ANSIColor;
use Socket;

$| = 1;

# command line parameters
my %params = (
    verbose      => 0,
    quiet        => 0,
    'no-cache'   => undef,
    'cache-file' => 'check_weak_dh_ssh.cache',
    'filter'     => 'tcp port 22',
);
my @options_spec = qw(
    verbose|v+
    quiet|q
    no-cache|nc
    cache-file|c=s
    filter:s
    no-dns|n
);
GetOptions(\%params, @options_spec) or pod2usage(-verbose => 1);

my $file = $ARGV[0];
if (! defined $file) {
    pod2usage(-verbose => 1);
    exit 1;
}
elsif (! -r $file) {
    print STDERR "ERROR: PCAP file '$file' not found or unreadable\n";
    exit 1;
}

my @priv  = read_privkeys();
my $cache = read_cache();

if (! $params{'quiet'}) {
    print "Loading PCAP file, this may take a while ...\n";
}

my $dump = Net::Packet::Dump->new(
    mode          => NP_DUMP_MODE_OFFLINE,
    file          => $file,
    filter        => $params{'filter'},
    unlinkOnClean => 0,
);

$dump->start;
$dump->nextAll;

my $connections;
my $vulnerable_clients;
my $invulnerable_clients;

FRAME:
for my $frame ($dump->frames) {
    next FRAME if (! $frame->l7); 
    my $data = $frame->l7->data;

    my $src_host = $frame->l3->src;
    my $dst_host = $frame->l3->dst;
    my $src  = $frame->l3->src . ':' . $frame->l4->src;
    my $dst  = $frame->l3->dst . ':' . $frame->l4->dst;

    my $packet_length  = hex(unpack("H*", substr($data, 0, 4)));
    my $padding_length = hex(unpack("H*", substr($data, 4, 1)));
    my $message_code   = hex(unpack("H*", substr($data, 5, 1)));
    my $payload        = substr($data, 6, $packet_length); 

    # we only look at the key exchange and ignore everything else
    next FRAME if ($message_code < 31 || $message_code > 32);

    if (! $params{quiet}) {
       print $frame->timestamp() . " $src > $dst: SSH message code $message_code\n";
   }
    if ($message_code == 31) {
        # group parameters sent by server
        my ($p, $g) = unpack_group_parameters($payload);
        if (defined $p && defined $g) {
            $connections->{$dst}->{$src}->{p} = $p;
            $connections->{$dst}->{$src}->{g} = $g;
        }
    }
    elsif ($message_code == 32) {
        # client's g^x sent to the server
        if (! exists $connections->{$src}->{$dst}) {
            print STDERR "Warning: client GEX Init frame identified, but group parameters are unknown, ignoring frame\n";
            next FRAME;
        }
        my $gx = unpack_gex_init($payload);

        # Try to solve the DL for g^x
        my $x = solve_dl({
            G  => $connections->{$src}->{$dst}->{g},
            P  => $connections->{$src}->{$dst}->{p},
            GX => $gx,
        });
        if (! defined $x) {
            if (! $params{quiet}) {
                print "\ndiscrete logarithm could not be solved, $src_host is ";
                print colored_if_tty("not vulnerable\n", 'green');
            }
            $invulnerable_clients->{$src_host} = 1;
        }
        else {
            if (! $params{quiet}) {
                print "\ndiscrete logarithm was solved, $src_host is ";
                print colored_if_tty("vulnerable\n", 'red');
            }
            $vulnerable_clients->{$src_host} = 1;
        }
    }
}

if (! $params{quiet}) {
    print "\n\n";
}

print "Vulnerable SSH clients:\n=======================\n";
foreach my $ip (keys %{ $vulnerable_clients }) {
    __print_ip($ip, 'red');
}
print "\n";

print "Invulnerable SSH clients:\n=========================\n";
foreach my $ip (keys %{ $invulnerable_clients }) {
    __print_ip($ip, 'green');
}

write_cache();

sub unpack_group_parameters {
    my $payload = shift;

    my $p_length = hex(unpack("H*", substr($payload, 0, 4)));
    # there are some weird packages, just ignore them if the p_length
    # is really small or really large ...
    # TODO - there should be a nicer way to detect them.
    return (undef, undef) if ($p_length < 100 || $p_length > 300);
    my $p = '0x' . unpack("H*", substr($payload, 4, $p_length));
    my $g_length = hex(unpack("H*", substr($payload, $p_length + 4, 4)));
    my $g = '0x' . unpack("H*", substr($payload, $p_length + 8, $g_length)); 

    return (Math::BigInt->new($p), Math::BigInt->new($g));
}

sub unpack_gex_init {
    my $payload = shift;

    my $gx_length = hex(unpack("H*", substr($payload, 0, 4)));
    my $gx = '0x' . unpack("H*", substr($payload, 4, $gx_length));

    return Math::BigInt->new($gx);
}

sub solve_dl {
    my $arg_ref = shift;
    my $gx      = $arg_ref->{GX};
    my $g       = $arg_ref->{G};
    my $p       = $arg_ref->{P};

    my $log;

    if (! $params{quiet}) {
        print "Trying to solve discrete logarithm";
    }
    if ($params{verbose} >= 1) {
        print "\n";
        print "g   = "   . $g->as_hex()  . "\n";
        print "g^x = "   . $gx->as_hex() . "\n";
        print "p   = "   . $p->as_hex()  . "\n";
    }

    my $g_hex  = $g->as_hex();
    my $p_hex  = $p->as_hex();
    my $gx_hex = $gx->as_hex();

    my $i = 0;
  TRY_EXP:
    foreach my $x (@priv) {
        my $x_hex = $x->as_hex();

        if ($params{verbose} < 3 && ! $params{quiet} && ($i % 1000 == 0)) {
            print ".";
        }
        if ($params{verbose} >= 3) {
            print "Trying x = " . $x_hex . "\n";
        }

        my $res = $cache->{$g_hex}->{$p_hex}->{$x_hex};

        if (! defined $res) {
            $res = $g->copy();
            $res->bmodpow($x, $p);
            # store as hex, we get a segfault if we store as Math::BigInt
            # object ... - !?
            $cache->{$g_hex}->{$p_hex}->{$x_hex} = $res->as_hex();
        }
        if (ref $res eq '') {
            # we need to convert hex to Math::BigInt if the result
            # came from the cache ...
            $res = Math::BigInt->new($res);
        }
        if ($gx->bcmp($res) == 0) {
            if ($params{verbose} >= 1) {
                print "Found discrete logarithm\n";
            }
            if ($params{verbose} >= 2) {
                print "x = " . $x->as_hex() . "\n";
            }
            $log = $x;
            last TRY_EXP;
        }
        $i++;
    }
    return $log;
}

sub read_privkeys {
    # the private keys (x in g^x) are stored in the DATA section
    my @priv = <DATA>;
    my $i = 0;
    if (! $params{quiet}) {
        print "Loading DH private keys";
    }
    foreach my $priv (@priv) {
        # convert them into Math::BigInt objects
        chomp $priv;
        $priv = '0x' . $priv;
        $priv = Math::BigInt->new($priv);
        if (! $params{quiet}) {
            if ($i % 1000 == 0) {
                print ".";
            }
        }
        $i++;
    }
    if (! $params{quiet}) {
        print "\n";
    }
    return @priv;
}

sub read_cache {
    my $cache;
    if (! $params{'no-cache'}) {
        # read in cache file using Storable if it exists
        if (-r $params{'cache-file'}) {
            $cache = lock_retrieve($params{'cache-file'});
        }
    }
    return $cache;
}

sub write_cache {
    if (! $params{'no-cache'}) {
        # write out cache file using Storable if possible
        eval {
            lock_nstore $cache, $params{'cache-file'};
        };
        if ($EVAL_ERROR) {
            if (! $params{quiet}) {
                print STDERR "Warning: could not write cache file " . $params{'cache-file'} . "\n";
            }
        }
    }
}

sub colored_if_tty {
    my $text  = shift;
    my $color = shift;
    if (-t \*STDOUT) {
        return colored($text, $color);
    }
    else {
        return $text;
    }
}

sub __print_ip {
    my $ip    = shift;
    my $color = shift;
    if (! $params{'no-dns'}) {
        my $hostname = gethostbyaddr(inet_aton($ip), AF_INET);
        if ($hostname) {
            $ip .= " [$hostname]";
        }
    }
    print colored_if_tty("  - $ip\n", $color);
}
=pod

=head1 NAME

check_weak_dh_ssh.pl - Check for weak Diffie-Hellmann key exchanges
                       involving SSH clients using Debian's broken OpenSSL

=head1 SYNOPSIS

check_weak_dh_ssh.pl [OPTIONS] PCAP-FILE

=head1 ARGUMENTS

  --verbose    or -v    Turns on verbose reporting, repeat for more info
  --quiet      or -q    Only output the final report, no status details
  --no-cache   or -nc   Do not use a cache file for exponentiations
  --cache-file or -c    Specify a cache file different from the
                        default (./check_weak_dh_ssh.cache)
  --filter              Specify a tcpdump-like filter different from
                        the default ('tcp port 22')
  --no-dns     or -n    Do no lookup hostnames for IP addresses

=cut

